import React from 'react'

const CartItem = ({name,quantity,price,totalPrice}) => {
  return (
    <div>
        <h2>{name}</h2>
        <p>${price}</p>
        <p>X{quantity}</p><button>+</button>
        <h4>total{totalPrice}</h4>
    </div>
  )
}

export default CartItem
